			DebugPrint( "Onboarding completed stage: " .. f7_arg2 )
			f7_local0 = true
			break
		end
	end
	if #f7_arg0._activeFlow.stages < f7_arg0._currentStage then
		f7_arg0:CompleteFlow()
	end
